import loggingimport botfrom getcontact.getcontact import GetContactAPIfrom telegram.ext import Updater, CommandHandler, MessageHandler, Filters# Enable logginglogging.basicConfig(format='%(asctime)s - %(name)s - %(levelname)s - %(message)s',                    level=logging.INFO)logger = logging.getLogger(__name__)getcontact = GetContactAPI()# Define a few command handlers. These usually take the two arguments update and# context. Error handlers also receive the raised TelegramError object in error.def start(update, context):    """Send a message when the command /start is issued."""    update.message.reply_text('''Hi!This bot will help you find out phone number''')def help(update, context):    """Send a message when the command /help is issued."""    update.message.reply_text('''/start - Start bot/help - This messagephone number - Find info by phone number''')def echo(update, context):    """Echo the user message."""    update.message.reply_text(getcontact.print_information_by_phone(update.message.text))def error(update, context):    """Log Errors caused by Updates."""    logger.warning('Update "%s" caused error "%s"', update, context.error)def main():    bot.start()    bot.add_handlers([CommandHandler("start", start),                      CommandHandler("help", help),                      MessageHandler(Filters.text, echo)])    bot.add_error_handlers(error)main()